DROP TABLE IF EXISTS `tb_room`;
CREATE TABLE `tb_room`  (
  `room_id` int(11) NOT NULL AUTO_INCREMENT,
  `room_owner` int(11) NOT NULL,
  `room_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `description` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `location` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `room_price` float(10, 2) NOT NULL,
  `is_available` int(11) NOT NULL DEFAULT 1 COMMENT '0不可用\r\n1可用',
  `del_flag` int(11) NOT NULL DEFAULT 0 COMMENT '0被删除1未被删除',
  PRIMARY KEY (`room_id`) USING BTREE,
  INDEX `key`(`room_owner`) USING BTREE,
  CONSTRAINT `key` FOREIGN KEY (`room_owner`) REFERENCES `tb_user` (`user_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 13 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

