INSERT INTO `tb_room` VALUES (1, 2, '｢含舍｣中亭街/上下杭/三坊七巷附近，全景飘窗，可做饭的豪华公寓电梯有独立卫生间', '你好哦(●ˇ∀ˇ●)很高兴选择了我们家o(*￣▽￣*)ブ首先简要介绍一下我们的房源情况。\r\n \r\n房源在高档社区的舒适宽敞独立单身公寓，不需与他人共享空间。', '福建省福州市XXXXXXXX', 188.00, 1, 0);
INSERT INTO `tb_room` VALUES (2, 2, '全景落地窗俯瞰榕城外滩江景浴缸房“北港”', '上午11:00之前请勿打扰房东休息。\r\n为不打扰之前入住的客人预定后在您入住当天上午11点告知您具体门牌号，入住时间发送进门密码', '福建省福州市XXXXXXXX', 150.00, 1, 0);
INSERT INTO `tb_room` VALUES (3, 2, '【直·白】设计师民宿/投影/近东泰禾/近火车站/拍照打卡/独立单身公寓/可长租', '我们的房间是一套独立单身公寓,套内面积30㎡，1.8*2米床。是由爱烘焙、爱折腾的建筑师房东亲自设计的，整体风格舒适温馨，采光很棒，夜景很美，适合爱拍照的你。', '福建省福州市XXXXXXXX', 242.00, 1, 0);
INSERT INTO `tb_room` VALUES (4, 2, '幕白大屏投影房/宝龙/东街/ /乳胶床垫/上下杭/三坊七巷/五一广场/宝龙/省人民医院', '【慵懒宿】\r\n（服务）打造私人平台更放心的民宿；\r\n床用品一客一换、毛巾浴巾严格消毒；\r\n室内卫生清洁细致，干净 温暖 放心！\r\n\r\n（理念）我们一直希望能给每一个入住在此的您提供一个温馨的环境，每一处都是精心布置.希望在你一天的劳累之后，能够安心的享受属于您的轻松自由时刻。非常适合情侣、单独旅行的冒险家和商务旅行者啦！', '福建省福州市XXXXXXXX', 199.00, 1, 0);
INSERT INTO `tb_room` VALUES (5, 2, '【真轻奢·市中心】西禅寺/三坊七巷/上下杭/至诚学院/宝龙广场/东街口/西湖/乌山/闽江/闽江学院', '⚠️：入住前退房后都可暂存行李。\r\n\r\n⚠️⚠️⚠️：重新上架的主卧比这间大，还有宽敞独立卫浴，类似单身公寓。因为新推，所以只多几元钱，很划算。点开房东头像（紫色花）可以看到哈。', '福建省福州市XXXXXXXX', 126.00, 1, 0);
INSERT INTO `tb_room` VALUES (6, 2, '暖宿「HOME春藤」极米巨幕投影房|达道地铁口旁45㎡整套日式|五星乳胶床|上下杭三坊七巷', 'Hi，很高兴您来我们家，先让我说说我们的“家庭情况”~\r\n\r\n暖宿「HOME春藤」，这是一套45㎡的干净超舒适的独门独户的整套公寓，达道地铁口步行600米距离，地铁2个站直达三坊七巷，宝龙万象城，比邻热门景点上下杭，周边很多美食小吃。想体验福州本土文化和美食的必不可错过这个区域｡', '福建省福州市XXXXXXXX', 215.00, 1, 0);
INSERT INTO `tb_room` VALUES (7, 2, '暖宿「HOME香草」极米巨幕投影| 达道地铁旁48㎡整套日式|采光好|带厨房|步行上下杭八中', 'Hi，很高兴您来我们家，先让我说说我们的“家庭情况”~\r\n\r\n暖宿「HOME香草」 ，这是一套48㎡的干净超舒适的独立整套公寓,位于福州老城区的市中心,周围遍布许多福州老字号美食和网红店,交通和购物都非常便捷，离地铁1号线达道站500米6分钟的步行时间，到福州的主要景区都非常方便,体验福州本土文化和美食的不可错过这个区域｡', '福建省福州市XXXXXXXX', 186.00, 1, 0);
INSERT INTO `tb_room` VALUES (8, 2, '五里亭地铁口2号线温馨浪漫单身公寓，泰禾广场/世欧广场周边', '床品一客一换，空调、智能网络电视。配备智能门锁，独立卫浴和厨房。厨房餐厅仅供加热食物，不接待聚餐聚会，使用后需要客人自行收拾干净餐厨用品。周边吃喝完乐购无比便捷，附近有大型商场，多家超市，餐饮品种更是齐全，步行五分钟就是当地就有名的宵夜一条街，各类小吃，料理，茶点，火锅，海鲜应有尽有生活非常便利。', '福建省福州市XXXXXXXX', 168.00, 1, 0);
INSERT INTO `tb_room` VALUES (9, 2, '「雕刻时光」仓山区福建师大/学生街首山路商圈烟台山/机场大巴/公交方便/58㎡一房一厅/时尚文艺套房', '※本房源所有室内照片均使用小米MIX手机实景拍摄，无PS无修图。如果此房源已经出租，可以点击房东头像看我们的其他房源。\r\n\r\n欢迎来到我的房子，我们坚持每客必换床单并定期消毒！我们坚持使用无印良品水洗棉与乳胶床品！我们坚持使用优质易耗品！', '福建省福州市XXXXXXXX', 168.00, 1, 0);
INSERT INTO `tb_room` VALUES (10, 2, '【大憩-芒】高层采光 近西禅寺宝龙 苏宁 高清影院大憩', '【房源详情】\r\n1.床1.5×2m\r\n2.自助式入住，配备安全电子锁，24小时安保。\r\n3.床单被套一客一换，干净卫生。\r\nps:第三人有加50元服务费，请按实际入住人数填写～请提前告知', '福建省福州市XXXXXXXX', 258.00, 1, 0);
INSERT INTO `tb_room` VALUES (11, 2, 'Starry Night | 一客一消毒 百寸投影 天窗 大露台 一号线 五四路', '这是一个名叫星月夜的温馨小屋\n\n百寸投影，蓝牙音响，还有一个看得见风景的天窗。\n室内面积42平，还附带一个10平的独立露台。\n\n床品一客一换，都采用60支以上的高档床上用品，且铺设乳胶记忆棉床垫，睡眠体验非常优秀\n\n希望旅途中的你能在这里驻足', '福建省福州市XXXXXXXX', 240.00, 1, 0);
INSERT INTO `tb_room` VALUES (12, 2, '达道站，上下杭-首推ins风系列私影大床套房', '新装开业，接受公司协议常住，价格实惠。房间配备高清影视设备和会员同步片源。环绕音响。让您在住酒店公寓的同时还可同享影视娱乐。所有房型均配置高端酒店使用的定制床垫，高品质定制布品。设计成经典纯欧式风格和现代年轻人喜欢的简约风格，积聚很多精力亲历打造，愿您有难忘的入住体验！', '福建省福州市XXXXXXXX', 232.00, 1, 0);

